import React, { useState } from 'react';

const API_BASE = 'http://localhost:5000';

const SearchStudent = () => {
  const [admissionNo, setAdmissionNo] = useState('');
  const [name, setName] = useState('');
  const [fatherName, setFatherName] = useState('');
  const [village, setVillage] = useState('');
  const [branch, setBranch] = useState('CSE');
  const [specialization, setSpecialization] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setDob] = useState('');
  const [semester, setSemester] = useState('');

  const [loading, setLoading] = useState(false);

  const handleAddStudent = async (e) => {
    e.preventDefault();
    if (loading) return;

    setLoading(true);

    const fd = new FormData();
    fd.append('admission_no', admissionNo);
    fd.append('name', name);
    fd.append('father_name', fatherName);
    fd.append('village', village);
    fd.append('branch', branch);
    fd.append('specialization', specialization);
    fd.append('phone', phone);
    fd.append('email', email);
    fd.append('dob', dob);
    fd.append('semester', semester || '1');

    try {
      console.log('üì§ Adding student:', admissionNo, name);
      const res = await fetch(`${API_BASE}/api/add_student`, {
        method: 'POST',
        body: fd,
      });

      const data = await res.json();
      console.log('üì• Add response:', data);

      if (res.ok && data.success) {
        window.alert(`‚úÖ ${name} added to students database!`);
        setAdmissionNo('');
        setName('');
        setFatherName('');
        setVillage('');
        setBranch('CSE');
        setSpecialization('');
        setPhone('');
        setEmail('');
        setDob('');
        setSemester('');
      } else {
        window.alert(data.error || 'Error adding student');
      }
    } catch (err) {
      console.error('‚ùå Add error:', err);
      window.alert('Network error - Check backend server');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="search-student-container">
      {/* Add student form only */}
      <form className="form-grid" onSubmit={handleAddStudent}>
        <input
          className="form-input"
          placeholder="Admission No *"
          value={admissionNo}
          onChange={(e) => setAdmissionNo(e.target.value)}
          required
          disabled={loading}
        />
        <input
          className="form-input"
          placeholder="Full Name *"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          disabled={loading}
        />
        <input
          className="form-input"
          placeholder="Father Name"
          value={fatherName}
          onChange={(e) => setFatherName(e.target.value)}
          disabled={loading}
        />
        <input
          className="form-input"
          placeholder="Village"
          value={village}
          onChange={(e) => setVillage(e.target.value)}
          disabled={loading}
        />
        <select
          className="form-select"
          value={branch}
          onChange={(e) => setBranch(e.target.value)}
          disabled={loading}
        >
          <option value="CSE">CSE</option>
          <option value="AIML">AIML</option>
          <option value="AIDS">AIDS</option>
          <option value="ECE">ECE</option>
          <option value="MECH">MECH</option>
        </select>
        <input
          className="form-input"
          placeholder="Specialization"
          value={specialization}
          onChange={(e) => setSpecialization(e.target.value)}
          disabled={loading}
        />
        <input
          className="form-input"
          placeholder="Phone *"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
          required
          disabled={loading}
        />
        <input
          className="form-input"
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          disabled={loading}
        />
        <input
          className="form-input"
          type="date"
          placeholder="Date of Birth"
          value={dob}
          onChange={(e) => setDob(e.target.value)}
          disabled={loading}
        />
        <input
          className="form-input"
          placeholder="Semester *"
          value={semester}
          onChange={(e) => setSemester(e.target.value)}
          required
          disabled={loading}
        />

        <button
          type="submit"
          className="form-btn"
          disabled={loading || !admissionNo || !name || !phone || !semester}
        >
          {loading ? '‚è≥ Adding...' : '‚ûï Add Student'}
        </button>
      </form>
    </div>
  );
};

export default SearchStudent;
